import '../styles/About.css';

export default class About extends React.Component {

render() {
    return (
      <div className="about">
      Software Developer with 6+ plus years of experience. I specialize in web application development and work on <br />
      Java, REST, Node.js, ReactJS, Spring, Hibernate. I was born in India and currently live in the United States.
      </div>
    )
}
}
